import React,{useState,useEffect} from 'react';
import Character from './Character';

const List = () => {
    const [characters,setCharacters] = useState(null)

    useEffect(() => {
        fetch("https://rickandmortyapi.com/api/character")
        .then(res => res.json())
        .then(data => {
            setCharacters(data.results)
        })
    }, [])
    return(
        <div>
            {}
        </div>
    );
};

export default List;
